import React from 'react';
import * as S from './styles'
import { SectionsNews } from './types';

const SectionsGoNews: React.FC<SectionsNews> = ({ reverse, image, title, description }) => {
  return (
    <S.Container reverse={true}>
      <img src="https://res.cloudinary.com/code-comunity/image/upload/v1632447633/site-gok/man_img.png" alt="" />
      <S.TextAndDescription>
        <h3>PRÊMIO VALOR INOVAÇÃO BRASIL: CASE DE SUCESSO COM A PERNAMBUCANAS</h3>
        <p>A Missão Covid é a maior startup no combate ao COVID-19 no Brasil. A plataforma, que foi criada em tempo recorde pelo time da GO.K: 48 horas - conecta médicos voluntários, por meio de videochamadas, à pacientes com sintomas da doença. A consulta é 100% online e gratuita.</p>
      </S.TextAndDescription>
    </S.Container>
  )
}

export default SectionsGoNews;
